column8:
新開発「泡タイプ」のコーティング剤。泡がボディの汚れを除去しながらコーティング被膜を形成します。<br>
だから、洗車からコーティングまで、コレ1本でOK。新開発のガラス系ポリマーにより、深い艶と高い撥水性を実現。<br>
内容量NET350ml。コーティング剤、スポンジ、マイクロファイバークロス、仕上げ用クロスのフルセット。<br>
<br><br>
【主な製品仕様 C77】<br>
<br>
